"original": |2-
     That page lists registries in protocol category groups, placing
     related registries together and making it easier for users of the
     registries to find the necessary information.  Clicking on the title
     of one of the registries on the IANA Protocol Registries page will
     take the reader to the details page for that registry.
"fixed": |-
  That page lists registries in protocol category groups, placing related registries together and making it easier for users of the registries to find the necessary information.  Clicking on the title of one of the registries on the IANA Protocol Registries page will take the reader to the details page for that registry.
"ko": |-
  해당 페이지에는 프로토콜 범주 그룹의 레지스트리가 나열되어 관련 레지스트리를 함께 배치하고 레지스트리 사용자가 필요한 정보를 더 쉽게 찾을 수 있도록 합니다. IANA 프로토콜 레지스트리 페이지에서 레지스트리 중 하나의 제목을 클릭하면 해당 레지스트리에 대한 세부 정보 페이지로 이동됩니다.
